import "@fontsource/roboto";
import { Box, CssBaseline, Toolbar, Typography } from "@material-ui/core";
import Drawer from "@material-ui/core/Drawer";
import { makeStyles } from "@material-ui/core/styles";
import ChevronRightIcon from "@material-ui/icons/ChevronRight";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";
import { TreeItem } from "@material-ui/lab";
import TreeView from "@material-ui/lab/TreeView";
import { AppBar } from "@mui/material";
import React from "react";
import "reflect-metadata";
import "./App.css";

import { BrowserRouter as Router, Routes, Link, Route } from "react-router-dom";

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
}));

function App() {
  const classes = useStyles();

  return (
    <Router>
      <div className="App">
        <div className={classes.root}>
          <Box sx={{ display: "flex" }}>
            <CssBaseline />
            <AppBar
              position="fixed"
              sx={{
                width: `calc(100% - ${drawerWidth}px)`,
                ml: `${drawerWidth}px`,
              }}
            >
              <Toolbar>
                <Typography variant="h6" noWrap component="div">
                  Clipped drawer
                </Typography>
              </Toolbar>
            </AppBar>

            <Drawer
              variant="permanent"
              anchor="left"
              className={classes.drawer}
              classes={{
                paper: classes.drawerPaper,
              }}
            >
              <TreeView
                className={classes.root}
                defaultCollapseIcon={<ExpandMoreIcon />}
                defaultExpandIcon={<ChevronRightIcon />}
              >
                <TreeItem nodeId="1" label="K1 125M">
                  <TreeItem nodeId="2" label="Ronde 1">
                    <TreeItem nodeId="3" label="PUP_H" />
                    <TreeItem nodeId="4" label="PUP_D" />
                    <TreeItem nodeId="5" label="MIN_H" />
                    <TreeItem nodeId="6" label="MIN_D" />
                    <TreeItem nodeId="7" label="KAD_H" />
                    <TreeItem nodeId="8" label="KAD_D" />
                    <TreeItem nodeId="9" label="ASP_H" />
                    <TreeItem nodeId="10" label="ASP_D" />
                    <TreeItem nodeId="11" label="JUN_H" />
                    <TreeItem nodeId="12" label="JUN_D" />
                    <TreeItem nodeId="13" label="SEN_H" />
                    <TreeItem nodeId="14" label="SEN_D" />
                  </TreeItem>
                  <TreeItem nodeId="15" label="Ronde 2">
                    <TreeItem nodeId="16" label="PUP_H" />
                    <TreeItem nodeId="17" label="PUP_D" />
                    <TreeItem nodeId="18" label="MIN_H" />
                    <TreeItem nodeId="18" label="MIN_D" />
                    <TreeItem nodeId="20" label="KAD_H" />
                    <TreeItem nodeId="21" label="KAD_D" />
                    <TreeItem nodeId="22" label="ASP_H" />
                    <TreeItem nodeId="23" label="ASP_D" />
                    <TreeItem nodeId="24" label="JUN_H" />
                    <TreeItem nodeId="25" label="JUN_D" />
                    <TreeItem nodeId="26" label="SEN_H" />
                    <TreeItem nodeId="27" label="SEN_D" />
                  </TreeItem>
                </TreeItem>
              </TreeView>
            </Drawer>
            <Box
              component="main"
              sx={{ flexGrow: 1, bgcolor: "background.default", p: 3 }}
            >
              <Toolbar />
              <Routes>
                <Route path="/hallo">
                  <h1>Hallo</h1>
                </Route>
                <Route path="/daag">
                  <hallo />
                </Route>
              </Routes>
            </Box>
          </Box>
        </div>
      </div>
    </Router>
  );
}

export default App;

function hallo() {
  return <h1>hallo</h1>;
}

function daag() {
  return <h1>daag</h1>;
}
